/**
 * Created by ovesh on 25/8/20.
 */
import React from 'react';
import {useState , useEffect } from 'react';
class Home extends React.Component{
    render(){
        return (
            <div>
                <Property/>
            </div>

        )
    }
}


function Property(){
    const [data , setData] = useState([]);

    useEffect( () => {
       fetchData();
    },[]);


    const fetchData = async () => {
        await  fetch("https://gateway.ayoblajar.com/services/user-service/api/system/country/findAll/default").then(
            (res) => {
                setData(oldData => oldData = res);

            }
        )

        console.log(data);

    };

    return (
        <div>
            <p>your at home</p>
        </div>
    );
}


export default Home;
